import React from "react";
import "./MoveItems.css";

function MoveItems() {
  return (
    <div className="MoveItems">
      <ul className="move-items-container">
        <li className="move-items-button-container">
          <button className="left-arrow move-button">
            <p className="move-shape-b">
              <p>Move shape</p>
            </p>
          </button>

          <button className="up-arrow move-button">
            <p className="move-position-b">Move position</p>
          </button>

          <button className="down-arrow move-button"></button>
          <button className="right-arrow move-button">
            <p className="move-shape-b">Move shape</p>
          </button>
        </li>
      </ul>
    </div>
  );
}

export default MoveItems;
